string = ''

container = ['g', 'z', 'b', 'z', 'w', 'z', 'j', 'w', 'w', 'r', 'f', 'f', 't', 'f']
counter = 14

def check_list():
    occurrence = {item: container.count(item) for item in container}
    for i in occurrence:
        if occurrence[i] > 1:
            return False


for i in string:
    if check_list() == False:
        container.pop(0)
        container.append(i)
        counter += 1
    else:
        print(container)
        print(counter)
        break

